function analysis(timestep, trial, figNum)



% get data

DDEBUG = 1;

KERNEL = 'epan';

D = parseDataMultiStep('particle_variable_epan.txt', 50);
[baseExp, baseStr] = getBaseline();

NUMREPEATS = 5;

PARTICLES = [500, 1000, 3000, 10000, 30000, 100000, 300000];
NUMTESTS = length(PARTICLES);

assert(trial > 0);
assert(trial <= NUMTESTS);

TIMEHOR = 5;
TIMESTEPS = 260;
COLORSTART = 0.3;

% plot





if(DDEBUG)
    fprintf('timestep: %d\n', timestep);
    fprintf('numParticles: %d\n', PARTICLES(trial));
end

figure(figNum);
close(figNum);
figure(figNum);
hold on;

for i=1:NUMREPEATS
    idx = (trial-1) * NUMREPEATS + i;
    if (DDEBUG)
        fprintf('plotting data from column %d\n', idx);
    end
    
    lineColor = [COLORSTART + (1 - COLORSTART)*(i-1)/NUMREPEATS ,0.5, 0.95];
    
    plot( D{2, idx}(timestep, :) , ...
          D{1, idx}(timestep, :), ...
          'color', lineColor, ...
          'DisplayName', sprintf('trial %d', i));
   

end
% baseline
plot(baseStr(timestep, :), baseExp(timestep, :), ...
     'color', 'g', ...
     'DisplayName', 'baseline');
legend('off');
legend('show');


hold off;

time = TIMEHOR/TIMESTEPS * timestep;

xlabel('Strikes');
ylabel('Expectation');
title(sprintf('t = %0.2f, kernel = %s, base particles = 10m, trial particles = %d\n', ...
      time, KERNEL, PARTICLES(trial)));


end





